export const Decode = (o) => {
    const s = String(o);
    const conf = {
        size: s.length,
        hash: [],
        decodedString: "",
        ms: 149995,
    };

    for (let i = 0; i < conf.size; i = i + 1) {
        let random = Math.floor(Math.random() * conf.ms);
        conf.hash.push(random - s.charCodeAt(i));
        conf.decodedString += hash[random];
    }
    return conf;
};

export const Undecode = (config) => {
    let u = "";
    while (u.length !== config.size) {
        let p = config.decodedString.slice(u.length * 3, u.length * 3 + 3);
        let i = hash.indexOf(p);
        let c = i - config.hash[u.length];
        u += String.fromCharCode(c);
    }
    return u;
};

